import React from 'react'

export default function MealsList(props) {


  props.mealsData.map(item => `<Mealitem
                                     id=${item.id}
                                     title=${item.title}
                                     desc=${item.desc}
                                     price=${item.price}
                                     img=${item.img}/>`)


  return (

    <div>
      <img src='../img/meals/1.png'></img>
      <div className='brief'>
        <h3 className='name'></h3>
        <p className='description'></p>
        <div>
          <span className='price'></span>
          <button className='number'></button>
        </div>
      </div>

    </div>
  )
}
